"""
: create venv
./venv/bin/python         -m pip install requests python-dotenv
./venv/Scripts/python.exe -m pip install requests python-dotenv
"""
import os
import requests
import json


from dotenv import load_dotenv ; load_dotenv() ;   access_token = os.environ.get('access_token')

owner_repo = 'pyenv/pyenv'
headers    = {'Authorization': f'token {access_token}'}  #NOTE musthave auth in header or we get rate limitted request
url        = f'https://api.github.com/repos/{owner_repo}/tags?per_page=100'  # max per_page is 100

res = requests.request('GET', url, headers=headers)
d   = res.json()

#region loop thru all pages
d_allpage = []
d_allpage.extend([*d])

while True:
  try:    next_url = res.links['next']['url']
  except: next_url = None
  if not next_url: break

  res = requests.request('GET', next_url, headers=headers)
  d   = res.json()
  d_allpage.extend([*d])
#endregion loop thru all pages
d = d_allpage


def add_created_at_field(d):
  # get created_at of tag d[0] thru its commit's created_at
  def get_commit_created_at(commit_sha):
    url = f'https://api.github.com/repos/{owner_repo}/commits/{commit_sha}'
    res = requests.request('GET', url, headers=headers)

    d = res.json()
    created_at = d["commit"]["author"]["date"]
    print(f'{commit_sha[:6]} {created_at}')
    return created_at
  # created_at = get_commit_created_at(commit_sha=d[0]['commit']['sha'])
  #            =                              for e in d

  d = [
    {**e, 'created_at': get_commit_created_at(commit_sha=e['commit']['sha'])}
    #      created_at added to dict :e
    for e in d
  ]
  return d
